//       try {
//       const response = await api.get(`/`)  
//       if (response.data.success) {
//         setUser(response.data.user_data)
//        console.log(user)
//       } else{
//         setError('error occured while fetching user profile')
//       }
//     }catch (error){
//       console.log('An unexpected errror occured');
//     }
//     };

//     fetchprofile()
// },[]);

const { id } = useParams();
const [user, setUser] = useState(null);

useEffect(() => {
    api.get(`/api/users/${id}/`)
        .then((response) => setUser(response.data))
        .catch((error) => console.error(error));
}, [id]);


  return (
    <body class="bg-white text-black font-sans">

    <header class="p-4 border-b border-gray-300">
      <div class="container mx-auto flex justify-between items-center">
        <h1 class="text-3xl font-bold">User Profile</h1>
        <nav class="space-x-4">
          <a href="#" class="text-gray-600 hover:text-black">Home</a>
          <a href="#" class="text-gray-600 hover:text-black">Settings</a>
          <a href="#" class="text-gray-600 hover:text-black">Logout</a>
        </nav>
      </div>
    </header>

    <main class="container mx-auto py-8">
      <section class="flex items-center space-x-8">
        <img 
          src="https://via.placeholder.com/150" 
          alt="Profile Picture" 
          class="w-36 h-36 rounded-full"
        />
        <div>
          <h2 class="text-4xl font-bold">John Doe</h2>
          <p class="text-gray-700">Software Developer at TechCorp</p>
          <p class="text-gray-700 mt-1">New York, USA</p>
        </div>
      </section>

      <section class="mt-8">
        <h3 class="text-2xl font-semibold mb-4">Details</h3>
        <dl class="grid grid-cols-1 md:grid-cols-2 gap-4">
          <div>
            <dt class="text-gray-500">Email</dt>
            <dd class="font-medium">john.doe@example.com</dd>
          </div>
          <div>
            <dt class="text-gray-500">Phone</dt>
            <dd class="font-medium">+123 456 7890</dd>
          </div>
          <div>
            <dt class="text-gray-500">Birthday</dt>
            <dd class="font-medium">January 1, 1990</dd>
          </div>
          <div>
            <dt class="text-gray-500">Location</dt>
            <dd class="font-medium">New York, USA</dd>
          </div>
          <div>
            <dt class="text-gray-500">Member Since</dt>
            <dd class="font-medium">March 2020</dd>
          </div>
          <div>
            <dt class="text-gray-500">Last Login</dt>
            <dd class="font-medium">November 28, 2024</dd>
          </div>
        </dl>
      </section>

      <section class="mt-8">
        <h3 class="text-2xl font-semibold mb-4">Bio</h3>
        <p class="text-gray-700 leading-relaxed">
          Passionate software developer with a knack for creating efficient and scalable applications. 
          Adept at working with modern technologies, solving complex problems, and collaborating with 
          cross-functional teams. Loves learning new things and sharing knowledge.
        </p>
      </section>
    </main>

    <footer class="p-4 border-t border-gray-300 text-center">
      <p class="text-gray-500">&copy; 2024 John Doe. All rights reserved.</p>
    </footer>

  </body>
  )
}
